  def extractEmails(self, line):
    return self.emailEx.findall(line)

  def extractPhoneNumbers(self, line):
    return self.phoneEx.findall(line)

  def extractURLs(self, line):
    return self.urlEx.findall(line)

  def extractSweetEntities(self, line):
    return self.sweetEx.findall(line)

  def extract(self):
    er = EntityResult()

    for l in self.lines:
      er.accumulate({
        'emails' : self.extractEmails(l),
        'phones' : self.extractPhoneNumbers(l),
        'urls'   : self.extractURLs(l),
        'sweet'  : self.extractSweetEntities(l),
      })

    return er.freqDistribution()
